oration-skip-ink:none;font-size:12pt;font-family:"Times New Roman";font-style:italic}.c2{margin-left:36pt;padding-top:0pt;padding-left:0pt;padding-bottom:0pt;line-height:1.0;orphans:2;widows:2;text-align:justify}.c4{color:#000000;font-weight:400;text-decoration:none;vertical-align:baseline;font-size:12pt;font-family:"Calibri";font-style:normal}.c9{color:#000000;font-weight:700;text-decoration:none;vertical-align:baseline;font-size:11pt;font-family:"Times New Roman";font-style:normal}.c3{color:#000000;font-weight:400;text-decoration:none;vertical-align:baseline;font-size:13.5pt;font-family:"Times New Roman";font-style:normal}.c12{color:#000000;font-weight:700;text-decoration:none;vertical-align:baseline;font-size:14pt;font-family:"Times New Roman";font-style:normal}.c1{color:#000000;font-weight:400;text-decoration:none;vertical-align:baseline;font-size:12pt;font-family:"Times New Roman";font-style:normal}.c13{color:#000000;font-weight:400;text-decoration:none;vertical-align:baseline;font-size:11pt;font-family:"Calibri";font-style:normal}.c8{color:#000000;font-weight:700;text-decoration:none;vertical-align:baseline;font-size:12pt;font-family:"Times New Roman";font-style:normal}.c20{padding-top:0pt;padding-bottom:14pt;line-height:1.0;orphans:2;widows:2;text-align:justify}.c10{padding-top:14pt;padding-bottom:14pt;line-height:1.0;orphans:2;widows:2;text-align:justify}.c18{padding-top:14pt;padding-bottom:0pt;line-height:1.0;orphans:2;widows:2;text-align:justify}.c11{padding-top:14pt;padding-bottom:10pt;line-height:1.0;orphans:2;widows:2;text-align:justify}.c6{font-size:12pt;font-family:"Times New Roman";font-style:italic;font-weight:700}.c19{color:#000000;text-decoration:none;vertical-align:baseline;font-style:italic}.c16{background-color:#ffffff;max-width:451.3pt;padding:72pt 72pt 72pt 72pt}.c7{font-size:12pt;font-family:"Times New Roman";font-weight:400}.c0{padding:0;margin:0}.c21{margin-left:18pt;text-indent:-18pt}.c14{margin-left:36pt;padding-left:0pt}.c15{color:inherit;text-decoration:inherit}.c17{height:11pt}.c22{color:#000000}.title{padding-top:24pt;color:#000000;font-weight:700;font-size:36pt;padding-bottom:6pt;font-family:"Calibri";line-height:1.1500000000000001;page-break-after:avoid;orphans:2;widows:2;text-align:left}.subtitle{padding-top:18pt;color:#666666;font-size:24pt;padding-bottom:4pt;font-family:"Georgia";line-height:1.1500000000000001;page-break-after:avoid;font-style:italic;orphans:2;widows:2;text-align:left}li{color:#000000;font-size:11pt;font-family:"Calibri"}p{margin:0;color:#000000;font-size:11pt;font-family:"Calibri"}h1{padding-top:0pt;color:#000000;font-weight:700;font-size:24pt;padding-bottom:10pt;font-family:"Times New Roman";line-height:1.0;orphans:2;widows:2;text-align:left}h2{padding-top:0pt;color:#000000;font-weight:700;font-size:18pt;padding-bottom:10pt;font-family:"Times New Roman";line-height:1.0;orphans:2;widows:2;text-align:left}h3{padding-top:0pt;color:#000000;font-weight:700;font-size:13.5pt;padding-bottom:10pt;font-family:"Times New Roman";line-height:1.0;orphans:2;widows:2;text-align:left}h4{padding-top:0pt;color:#000000;font-weight:700;font-size:12pt;padding-bottom:10pt;font-family:"Times New Roman";line-height:1.0;orphans:2;widows:2;text-align:left}h5{padding-top:0pt;color:#000000;font-weight:700;font-size:10pt;padding-bottom:10pt;font-family:"Times New Roman";line-height:1.0;orphans:2;widows:2;text-align:left}h6{padding-top:10pt;color:#000000;font-weight:700;font-size:10pt;padding-bottom:2pt;font-family:"Calibri";line-height:1.1500000000000001;page-break-after:avoid;orphans:2;widows:2;text-align:left}</style></head><body class="c16"><p class="c20"><span class="c12">InCharge Privacy Policy</span></p><p class="c10"><span class="c7 c19">Dated: 17 March, 2019</span></p><p class="c10"><span class="c6">InCharge </span><span class="c7">is an app created by GATO Health Ltd for the purpose of helping women know the option most suitable to them for birth control, monitoring their menstrual cycle, helping them locate family planning clinics close to them, as well as other features related to reproductive health. We take your privacy seriously, and we are committed to maintaining the privacy of the personal information that you provide to us. This policy explains our information practices and how we process your information to provide our services. By using </span><span class="c6">InCharge,</span><span class="c1">&nbsp;you acknowledge that the provisions in this Privacy Policy will apply to you, as well as to any information that you provide us. Please take the time to read through this Privacy Policy to get acquainted with our practices.</span></p><ol class="c0 lst-kix_list_5-0 start" start="1"><li class="c10 c14"><span class="c12">The types or categories of personally identifiable data collected by the app.</span></li></ol><p class="c10"><span class="c1">We must collect some of your personal information to provide, support, and improve our services. Some of the ways that we may collect personal information include information that you provide us directly such as your Email Address, Phone Number, Area of Residence/Location, Age, Sex, Number of Children, Marital Status, Educational Status, Occupation and Religion.</span></p><ol class="c0 lst-kix_list_1-0 start" start="1"><li class="c10 c14"><span class="c8">Information that you provide us directly</span></li></ol><p class="c10"><span class="c1">Information you give us when you register an account. We use your email address as your account identifier, and you will need to provide it to create an account. You will also have to provide your first and last name, and a username in your profile.</span></p><p class="c10"><span class="c8">How do we use it?</span></p><ul class="c0 lst-kix_list_2-0 start"><li class="c14 c18"><span class="c7">To enable you to access to, and use of the Service, including to manage user information and accounts; </span></li><li class="c2"><span class="c7">To contact you to answer requests for customer support;</span></li><li class="c2"><span class="c7">To customize your experience;</span></li><li class="c2"><span class="c7">To conduct research and development in order to test and introduce new features and products, and to improve and monitor the effectiveness of our Service.</span></li><li class="c2"><span class="c7">To enforce our Terms of Service;</span></li><li class="c20 c14"><span class="c7">For any other purpose(s) that we specifically communicate to you when we collect that information with your consent, or for which we have a legitimate interest.</span></li></ul><p class="c10"><span class="c9">Other things you should know:</span></p><ul class="c0 lst-kix_list_3-0 start"><li class="c10 c14"><span class="c7">We may remove, at our sole discretion, any information that you provide when you register for or use the Service (such as usernames, names, etc.), if we believe it is inappropriate or violates any of the policies including, but not limited to, our Terms of Service.</span></li></ul><ol class="c0 lst-kix_list_1-0" start="2"><li class="c10 c14"><span class="c8">Area of Residence/Location</span></li></ol><p class="c10"><span class="c7">Area of Residence/Location provided while registering on the app is strictly confidential and will only be used by GATO Health Ltd for the purpose of research and to improve the Service provided. </span></p><p class="c10"><span class="c8">c. Personal info for potential research and to observe demographic differences.</span></p><p class="c10"><span class="c1">All medical information provided are strictly used to determine the best birth control (contraception) option available so as to suggest the best possible choice to be used, as well as for tracking of the menstrual cycle. Such information is strictly confidential and will not be shared with or revealed to any third party without your express approval.</span></p><ol class="c0 lst-kix_list_5-0" start="2"><li class="c10 c14"><span class="c12">Opting out of Receiving Communications</span></li></ol><p class="c10"><span class="c1">You have the right to opt out of certain uses and disclosures of your personal information.</span></p><p class="c10"><span class="c8">a. Email and phone communications</span></p><p class="c10"><span class="c1">If you receive an unwanted email from us, you can use the unsubscribe link found at the bottom of the email to opt-out of receiving future emails. We will process your request within a reasonable time after receipt. Note that you will continue to receive transaction-related emails regarding products or services you have requested. We may also send you certain non-promotional communications regarding our Services and you will not be able to opt out of those communications (e.g., communications regarding updates to our Terms or this Privacy Policy).</span></p><p class="c10"><span class="c8">b. Mobile devices</span></p><p class="c10"><span class="c6">InCharge</span><span class="c1">&nbsp;may occasionally send you push notifications through our mobile applications. You may at any time opt-out from receiving these types of communications by changing the settings on your mobile device. </span></p><p class="c10 c17"><span class="c1"></span></p><ol class="c0 lst-kix_list_5-0" start="3"><li class="c10 c14"><span class="c12">Rights of access, rectification, erasure, and restriction</span></li></ol><p class="c10"><span class="c1">You can edit, update, or delete your account at any time.</span></p><p class="c10"><span class="c7">Although </span><span class="c6">InCharge</span><span class="c7">&nbsp;makes good faith efforts to provide individuals with access to their personal information, there may be circumstances in which </span><span class="c6">InCharge </span><span class="c1">is unable to provide access, including but not limited to: </span></p><ul class="c0 lst-kix_list_6-0 start"><li class="c18 c14"><span class="c1">Where the information contains legal privilege, would compromise others&rsquo; privacy or other legitimate rights;</span></li><li class="c2"><span class="c1">Where the burden or expense of providing access would be disproportionate to the risks to the individual&rsquo;s privacy in the case in question; or </span></li><li class="c14 c20"><span class="c1">Where it is commercially proprietary.</span></li></ul><p class="c10 c21"><span class="c7">If </span><span class="c6">InCharge</span><span class="c1">&nbsp;determines that access should be restricted in any particular instance, we will provide you with an explanation of why that determination has been made and a contact point for any further inquiries. To protect your privacy, we will take reasonable steps to verify your identity before granting access to or making any changes to your personal information.</span></p><ol class="c0 lst-kix_list_5-0" start="4"><li class="c10 c14"><span class="c12">Data Retention</span></li></ol><p class="c10"><span class="c6">InCharge</span><span class="c1">&nbsp;retains the personal information we receive as described in this Privacy Policy for as long as you use our Services or as necessary to fulfil the purpose(s) for which it was collected, to provide our Services, to resolve disputes, to establish legal defences, to enforce our agreements, and comply with applicable laws.</span></p><ol class="c0 lst-kix_list_5-0" start="5"><li class="c10 c14"><span class="c12">Security</span></li></ol><p class="c10"><span class="c1">Your account and registration information are protected so that only you can access your account. While we are committed to implementing reasonable and appropriate safeguards to protect your information against foreseeable risks, no computer system or information can ever be fully protected against any possible risk, and we cannot guarantee that unauthorized third parties will not be able to circumvent those safeguards, or access and/or use your personal information for improper purposes.</span></p><p class="c10"><span class="c1">By using the Service or providing personal information to us, you agree that we may communicate with you electronically regarding security, privacy, and administrative issues relating to your use of the Service. If we learn of a security system&rsquo;s breach, we may attempt to notify you electronically by posting a notice within the Service.</span></p><ol class="c0 lst-kix_list_5-0" start="6"><li class="c10 c14"><span class="c12">Children&rsquo;s privacy</span></li></ol><p class="c10"><span class="c1">Our Services are not directed at persons under 18 years of age. You must therefore be 18 years or older to use our Services. We do not knowingly collect Personally Identifiable Information from persons under 18 years of age. If we learn that we have collected any personal information from children under 18, we will promptly take steps to delete such information and terminate the person&rsquo;s account.</span></p><ol class="c0 lst-kix_list_5-0" start="7"><li class="c10 c14"><span class="c12">Redress and accountability</span></li></ol><p class="c10"><span class="c7">Any questions, complaints or requests about our privacy practices or this Privacy Policy should be addressed to our email address </span><span class="c6">(</span><span class="c5"><a class="c15" href="mailto:gatohealthltd@gmail.com">gatohealthltd@gmail.com</a></span><span class="c1">) We will address your concerns and attempt to resolve any privacy issues in a timely manner.</span></p><ol class="c0 lst-kix_list_5-0" start="8"><li class="c10 c14"><span class="c12">Changes to our Privacy Policy</span></li></ol><p class="c10"><span class="c1">We may modify our Privacy Policy from time to time. When we make changes, we will notify you by making the revised version available on this webpage, and will indicate at the top the date of the latest revision. You should check this Privacy Policy on a regular basis, since revised versions will be binding on you. Any such modifications will be effective when we post the updated Privacy Policy. You